void* LonGetFile(int file_index, unsigned* pSize) {
    void* result = NULL;
    switch(file_index) {
        case LON_DMF_FILEINDEX_DIRECTORY:
            result = &__directory;
            *pSize = sizeof(__directory);
            break;
        case LON_DMF_FILEINDEX_TEMPLATE:
            result = &__template;
            *pSize = sizeof(__template);
            break;
        case LON_DMF_FILEINDEX_MODIFIABLE:
            result = &__modifiable;
            *pSize = sizeof(__modifiable);
            break;
        case LON_DMF_FILEINDEX_READONLY:
            result = &__readonly;
            *pSize = sizeof(__readonly);
            break;
    }
    return result;
}

